<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="Outliers">Outliers<a class="anchor-link" href="#Outliers">&#182;</a></h1>
</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Outliers are data point that differ significantly from other observations. They can reveal some unknown patterns (machine failure, systems fraud...) or they can be errors due to specific circumstances.</p>
<p>Besides, some Machine Learning Algorithmes are sensible to outliers. They can destroy the final predictions as they are adding bias to the data.</p>
<p>Handling them is one of the most important steps of the Data Preparation life cycle.</p>
<p>There are 3 main types of outliers:</p>
<ul class="ul_content">
<li><b>Global Outliers</b> : Their values are far outside the entirety of the data set in which they are found</li>
<li><b>Contextual Outliers</b> : Their values significantly deviates from the rest of the data points in the same context</li>
<li><b>Collective Outliers</b> : Their values as a collection deviate significantly from the entire data set but they are not global or contextual outliers</li>
</ul>
<p>The most critical ones are the Global Outliers as they are the ones responsible for adding a lot of bias to the data. We can found them easily by computing the Z-Score. Let's look at some examples using the 'Heart Disease' dataset where we have different information on patients who probably have complications.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[10]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python</span> <span class="k">import</span> <span class="o">*</span>
<span class="n">vdf</span> <span class="o">=</span> <span class="n">vDataFrame</span><span class="p">(</span><span class="s2">&quot;heart&quot;</span><span class="p">)</span>
<span class="nb">print</span><span class="p">(</span><span class="n">vdf</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

