lid white;">1</td><td style="border: 1px solid white;">0.0</td><td style="border: 1px solid white;">0.0</td><td style="border: 1px solid white;">1.0</td><td style="border: 1px solid white;">0.0</td><td style="border: 1px solid white;">182.0</td><td style="border: 1px solid white;">0.0</td><td style="border: 1px solid white;">183.0</td><td style="border: 1px solid white;">0.0</td><td style="border: 1px solid white;">138.0</td><td style="border: 1px solid white;">1.4</td><td style="border: 1px solid white;">35.0</td></tr><tr style="{border: 1px solid white;}"><td style="border-bottom: 1px solid #DDD;font-size:1.02em;background-color:#214579;color:white"><b>4</b></td><td style="border: 1px solid white;">4.0</td><td style="border: 1px solid white;">7.0</td><td style="border: 1px solid white;">2</td><td style="border: 1px solid white;">0.0</td><td style="border: 1px solid white;">0.0</td><td style="border: 1px solid white;">2.0</td><td style="border: 1px solid white;">1.0</td><td style="border: 1px solid white;">130.0</td><td style="border: 1px solid white;">1.0</td><td style="border: 1px solid white;">198.0</td><td style="border: 1px solid white;">0.0</td><td style="border: 1px solid white;">120.0</td><td style="border: 1px solid white;">1.6</td><td style="border: 1px solid white;">35.0</td></tr><tr><td style="border-top: 1px solid white;background-color:#214579;color:white"></td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="borde