</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Let's use only the maximum heart rate achieved (thalach) and the serum cholestoral (chol) to identify some outliers.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[136]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="o">%</span><span class="k">matplotlib</span> inline
<span class="n">vdf</span><span class="o">.</span><span class="n">scatter</span><span class="p">([</span><span class="s2">&quot;thalach&quot;</span><span class="p">,</span> <span class="s2">&quot;chol&quot;</span><span class="p">])</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can see some outliers of the distributions. People having a high cholesterol and others having a very low heart rate. Let's compute the global outliers using the 'outliers' method.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[11]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">outliers</span><span class="p">([</span><span class="s2">&quot;thalach&quot;</span><span class="p">,</span> <span class="s2">&quot;chol&quot;</span><span class="p">],</span> <span class="s2">&quot;global_outliers&quot;</span><span class="p">)</span>
<span class="n">vdf</span><span class="o">.</span><span class="n">scatter</span><span class="p">([</span><span class="s2">&quot;thalach&quot;</span><span class="p">,</span> <span class="s2">&quot;chol&quot;</span><span class="p">],</span> <span class="n">catcol</span> <span class="o">=</span> <span class="s2">&quot;global_outliers&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We detected some global outliers of the distribution. It is easy to impute them using the 'fill_outliers' method. Generally, Global Outliers are identified using the Z-Score. We consider that having a Z-Score greater than 3 means that the concerned data point is an outlier. Some less precise techniques consider the data points belonging to the first and last alpha-quantile are outliers. It is possible to pick up one of the two strategies when computing and filling outliers.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[12]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="p">[</span><span class="s2">&quot;thalach&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">fill_outliers</span><span class="p">(</span><span class="n">use_threshold</span> <span class="o">=</span> <span class="kc">True</span><span class="p">,</span>
                             <span class="n">threshold</span> <span class="o">=</span> <span class="mf">3.0</span><span class="p">,</span>
                             <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;winsorize&quot;</span><span class="p">)</span>
<span class="n">vdf</span><span class="p">[</span><span class="s2">&quot;chol&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">fill_outliers</span><span class="p">(</span><span class="n">use_threshold</span> <span class="o">=</span> <span class="kc">True</span><span class="p">,</span>
                          <span class="n">threshold</span> <span class="o">=</span> <span class="mf">3.0</span><span class="p">,</span>
                          <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;winsorize&quot;</span><span class="p">)</span>
<span class="n">vdf</span><span class="o">.</span><span class="n">scatter</span><span class="p">([</span><span class="s2">&quot;thalach&quot;</span><span class="p">,</span> <span class="s2">&quot;chol&quot;</span><span class="p">],</span> <span class="n">catcol</span> <span class="o">=</span> <span class="s2">&quot;global_outliers&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Other techniques like DBSCAN or LOF (Local Outlier Factor) can be used to detect other data points which can be possible outliers.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[6]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python.learn.cluster</span> <span class="k">import</span> <span class="n">DBSCAN</span>

<span class="n">drop_table</span><span class="p">(</span><span class="s2">&quot;dbscan_heart&quot;</span><span class="p">)</span>
<span class="n">model</span> <span class="o">=</span> <span class="n">DBSCAN</span><span class="p">(</span><span class="s2">&quot;dbscan_heart&quot;</span><span class="p">,</span> <span class="n">eps</span> <span class="o">=</span> <span class="mi">20</span><span class="p">,</span> <span class="n">min_samples</span> <span class="o">=</span> <span class="mi">10</span><span class="p">)</span>
<span class="n">model</span><span class="o">.</span><span class="n">fit</span><span class="p">(</span><span class="s2">&quot;heart&quot;</span><span class="p">,</span> <span class="p">[</span><span class="s2">&quot;thalach&quot;</span><span class="p">,</span> <span class="s2">&quot;chol&quot;</span><span class="p">])</span>
<span class="n">model</span><span class="o">.</span><span class="n">plot</span><span class="p">()</span>
<span class="n">vdf_tmp</span> <span class="o">=</span> <span class="n">model</span><span class="o">.</span><span class="n">to_vdf</span><span class="p">()</span>
<span class="n">vdf_tmp</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="n">name</span> <span class="o">=</span> <span class="s2">&quot;outliers_dbscan&quot;</span><span class="p">,</span>
             <span class="n">expr</span> <span class="o">=</span> <span class="s2">&quot;(dbscan_cluster = -1)::int&quot;</span><span class="p">)</span>
<span class="n">vdf_tmp</span><span class="o">.</span><span class="n">scatter</span><span class="p">([</span><span class="s2">&quot;thalach&quot;</span><span class="p">,</span> <span class="s2">&quot;chol&quot;</span><span class="p">],</span> <span class="n">catcol</span> <span class="o">=</span> <span class="s2">&quot;outliers_dbscan&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>


<div class="output_subarea output_stream output_stdout output_text">
<pre>The table dbscan_heart was successfully dropped.
</pre>
</div>
</div>

<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>DBSCAN will identify outliers during the clusters computation whereas LOF will compute an Outlier Score. We generally consider that a LOF Score greater than 1.5 means that the concerned data points are outliers.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[7]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python.learn.neighbors</span> <span class="k">import</span> <span class="n">LocalOutlierFactor</span>

<span class="n">drop_table</span><span class="p">(</span><span class="s2">&quot;lof_heart&quot;</span><span class="p">)</span>
<span class="n">model</span> <span class="o">=</span> <span class="n">LocalOutlierFactor</span><span class="p">(</span><span class="s2">&quot;lof_heart&quot;</span><span class="p">)</span>
<span class="n">model</span><span class="o">.</span><span class="n">fit</span><span class="p">(</span><span class="s2">&quot;heart&quot;</span><span class="p">,</span> <span class="p">[</span><span class="s2">&quot;thalach&quot;</span><span class="p">,</span> <span class="s2">&quot;chol&quot;</span><span class="p">])</span>
<span class="n">model</span><span class="o">.</span><span class="n">plot</span><span class="p">()</span>
<span class="n">lof_heart</span> <span class="o">=</span> <span class="n">model</span><span class="o">.</span><span class="n">to_vdf</span><span class="p">()</span>
<span class="n">lof_heart</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="s2">&quot;outliers&quot;</span><span class="p">,</span> <span class="s2">&quot;(CASE WHEN lof_score &gt; 1.5 THEN 1 ELSE 0 END)&quot;</span><span class="p">)</span>
<span class="n">lof_heart</span><span class="o">.</span><span class="n">scatter</span><span class="p">([</span><span class="s2">&quot;thalach&quot;</span><span class="p">,</span> <span class="s2">&quot;chol&quot;</span><span class="p">],</span> <span class="n">catcol</span> <span class="o">=</span> <span class="s2">&quot;outliers&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>


<div class="output_subarea output_stream output_stdout output_text">
<pre>The table lof_heart was successfully dropped.
</pre>
</div>
</div>

<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Other techniques like the KMeans clustering can help us to find other outliers. However the most important method is finding the Global Outliers using the Z-Score. They are easy to find and they can bring us a lot of information on the data. When we took the decision on how handling outliers, we can use different techniques to impute the missing values. Out next lesson is focused on missing values imputation.</p>

</div>
</div>
</div>